import React from "react";
import Button from "./Re-usable/Button";
import { Link } from "react-router-dom";


const OrganList = ({organs, findOrgan}) => {
    const organList = organs.map(organ => {
        return (
        <div key={organ._id}>
         <Link to="/organ/:id"><Button value={organ._id} onClick={() => findOrgan(organ._id)} text={organ.name}/></Link>
        </div>)
    })

    return ( 
        <section>
            <h2>Choose your organ:</h2>
            <ul>
                {organList}
            </ul>
        </section>
     );
}

export default OrganList;
